import React, { Component } from "react";

class ListMenu extends Component {
  render() {
    return (
      <div
        className="row"
        style={{
          marginLeft: "20px",
          marginTop: "30px",
          height: "600px",
          width: "200px"
        }}
      >
        <div className="col-sm-6">
          <div className="card">
            <div className="card-body">
              <h5
                className="card-title font-weight-bold"
                style={{
                  fontSize: "12px",
                  float: "left",
                  fontStyle: "bolt",
                  color: "#636e72"
                }}
              >
                CHOOSE ROBOT TYPE
              </h5>
              <div className="row" />
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default ListMenu;
